import React, { useState, useRef } from 'react';
import LandingPage from './components/LandingPage';

import DontFuckUp from './components/DontFuckUp';

import './index.css'; // Adjust the path as necessary
import OurMission from './components/OurMission';
import Footer from './components/Footer';


function App() {



  return (
    <div classname="">
    <div className= "px-0 normalcontainer">
    <DontFuckUp /> {/* Use the DontFuckUp component */}
  </div>
    <div className="App ">






      {/* bg-gradient-to-r from-violet-200 to-pink-200 */}

      <div className="App bg-gradient-to-r from-white to-pink-100 pt-20 ">
      <div className="normalcontainer">
        <LandingPage  />
      </div>
      </div>


      <div className="App bg-gradient-to-r from-white to-pink-100  ">


      <div className=" pb-10 normalcontainer " >  
        <OurMission />
      </div>


      <Footer />


      </div>

    </div>
</div>


  );
}

export default App;
